	function generateProduct(shape, color, pattern, patternColor) {
		let product = {};
		product.id = getArrayIndex(shapes, "name", shape.name).toString().padStart(2, "0");
		product.id += getArrayIndex(colors, "name", color.name).toString().padStart(2, "0");
		product.id += getArrayIndex(patterns, "name", pattern.name).toString().padStart(2, "0");
		product.id += getArrayIndex(colors, "name", patternColor.name).toString().padStart(2, "0");
		if (pattern.name === "solid") product.name = `Solid ${color.name} ${shape.name}`;
		else if (color.name === patternColor.name) product.name = `${color.name.charAt(0).toUpperCase() + color.name.slice(1)} ${shape.name} with ${pattern.name} pattern`;
		else product.name = `${color.name.charAt(0).toUpperCase() + color.name.slice(1)} ${shape.name} with ${patternColor.name} ${pattern.name} pattern`;
		product.price = toFixedNumber(parseFloat(randomValue(1, 39) + 0.99), 2);
		if (randomValue(0, 100) < 5) product.oldPrice = Math.floor((randomValue(110, 160) / 100) * product.price) + 0.99;
		product.date = `${randomValue(2020, 2023)}-${randomValue(1, 12).toString().padStart(2, "0")}-${randomValue(1, 20).toString().padStart(2, "0")}`;
		if (["02000702", "01030102", "00010403"].includes(product.id)) {
			product.isFeatured = true;
		} else product.isFeatured = false;
		product.rating = toFixedNumber(parseFloat(randomValue(150, 490) / 100), 2);
		product.soldInLast30Days = parseInt(product.rating * randomValue(40, 50));
		product.description = `This `;
		product.description += adjectives[randomValue(0, adjectives.length - 1)];
		product.description += ` ${shape.name} is characterised by `;
		product.description += features[randomValue(0, features.length - 1)];
		product.description += `. `;
		const adjective = adjectives[randomValue(0, adjectives.length - 1)];
		if (color.name !== patternColor.name) product.description += `${adjective.charAt(0).toUpperCase() + adjective.slice(1)} combination of ${color.name} and ${patternColor.name}`;
		else if (color.name === patternColor.name && pattern.name !== "solid") product.description += `Harmonious combination of two tints of ${color.name}`;
		else product.description += `${adjective.charAt(0).toUpperCase() + adjective.slice(1)} shade of ${color.name}`;
		if (pattern.name !== "solid") product.description += ` and the original ${pattern.name} pattern`;
		product.description += ` ${endings[randomValue(0, endings.length - 1)]}`;
		product.image = `<div style="position: absolute; clip-path: url(#shape-${shape.name}); inline-size: 70%; aspect-ratio: 1; background-color: oklch(0.66 0.21 ${color.hue});"></div>`;
		if (pattern.name !== "solid") product.image += `<div style="position: absolute; clip-path: url(#shape-${shape.name}); inline-size: 70%; aspect-ratio: 1; background-color: oklch(0.46 0.21 ${patternColor.hue}); mask-image: var(--pattern-${pattern.name}); mask-position: ${shape.position}; mask-size: ${pattern.size}px"></div>`;
		product.cartQuantity = 0;
		product.filters = {
			category: [shape.namePlural.charAt(0).toUpperCase() + shape.namePlural.slice(1)],
			colors: [...new Set([color.name, patternColor.name])],
			pattern: [pattern.name],
		};
		return product;
	}

